import React from 'react';

const defaultEquipment = [
  { id: 'bench-press', name: 'Bench Press', category: 'Upper Body', videoId: 'rT7DgCr-3pg' },
  { id: 'leg-press', name: 'Leg Press', category: 'Lower Body', videoId: 'IZxyjW7MPJQ' },
  { id: 'lat-pulldown', name: 'Lat Pulldown', category: 'Upper Body', videoId: 'CAwf7n6Luuc' },
  { id: 'chest-press', name: 'Chest Press Machine', category: 'Upper Body', videoId: 'xUm0BiZCWzQ' },
  { id: 'leg-extension', name: 'Leg Extension', category: 'Lower Body', videoId: 'YyvSfVjQeL0' },
  { id: 'leg-curl', name: 'Leg Curl', category: 'Lower Body', videoId: 'ELOCsoDSmrg' },
  { id: 'shoulder-press', name: 'Shoulder Press', category: 'Upper Body', videoId: 'Wqq43dKW1TU' },
  { id: 'cable-row', name: 'Cable Row', category: 'Upper Body', videoId: 'GZbfZ033f74' },
  { id: 'squat-rack', name: 'Squat Rack', category: 'Lower Body', videoId: 'SW_C1A-rejs' },
  { id: 'smith-machine', name: 'Smith Machine', category: 'Full Body', videoId: 'Iwe6AmxVf7o' },
];

export default function GymEquipment({ selectedEquipment, setSelectedEquipment }) {
  const handleToggleEquipment = (equipmentId) => {
    if (selectedEquipment.includes(equipmentId)) {
      setSelectedEquipment(selectedEquipment.filter(id => id !== equipmentId));
    } else {
      setSelectedEquipment([...selectedEquipment, equipmentId]);
    }
  };

  return (
    <div className="p-4">
      <h2 className="text-xl font-bold mb-4">Select Available Equipment</h2>
      <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-4">
        {defaultEquipment.map((equipment) => (
          <button
            key={equipment.id}
            onClick={() => handleToggleEquipment(equipment.id)}
            className={`p-4 rounded-lg text-left transition-colors ${
              selectedEquipment.includes(equipment.id)
                ? 'bg-blue-500 text-white'
                : 'bg-gray-100 hover:bg-gray-200'
            }`}
          >
            <div className="font-semibold">{equipment.name}</div>
            <div className="text-sm opacity-75">{equipment.category}</div>
          </button>
        ))}
      </div>
    </div>
  );
}

export { defaultEquipment };
